import React from 'react';
import { storiesOf } from '@storybook/react';
import { action } from '@storybook/addon-actions';
import { Button } from '@storybook/react/demo';
import { withKnobs, text, select, boolean, object } from '@storybook/addon-knobs';
const themes = ['primary', 'secondary'];


// export default {
//   title: 'Widgets',
// };

// export const Widget1 = () => <Button> Hola </Button>




storiesOf('Project', module)
	.addDecorator(withKnobs)

	.add('Widgets', () => (
		<React.Fragment>
			<Button label={text('label', 'Hello World !')} />
			<Button label="Button with secondary theme" theme="secondary" />
			<Button label="Button with 3 theme" theme="third" />

		</React.Fragment>
	))
	.add('with label', () => <Button label={text('label', 'Hello Button')} />)
